import React, { Component } from 'react'
import './ContactIntro.css'

export default class ContactIntro extends Component {
  render() {
    return (
      <div className="ContactIntro">
        <hr>
          <h1>Get In Touch</h1>
        </hr>
      </div>
    )
  }
}
